pragma solidity ^0.6.2;

import "./../SignDocuBussiness.sol";
import "./../SignDocuStorage.sol";

library Utils {
    function getStateFromUint(uint256 _state) public pure returns(State) {
        if (_state == 1) {
            return State.Created;
        }
        if (_state == 2) {
            return State.SignPending;
        }
        if (_state == 3) {
            return State.Signed;
        }
    }
}

contract SignDocuBussinessMock is SignDocuStorage {

    address bussinessContract;

    constructor() public {
        SignDocuBussiness signDocu = new SignDocuBussiness();
        bussinessContract = address(signDocu);
    }

    function setForAccountCreation() public {
        bussinessContract = address(new ProxyForAccountCreation());
    }

    function setForApprovalAccountCreation() public {
        bussinessContract = address(new ProxyForApprovingAccountCreation());
    }

    function setForDocumentCreation() public {
        bussinessContract = address(new ProxyForDocumentCreation());
    }

    function setForSigningCreation() public {
        bussinessContract = address(new ProxyForDocumentSigning());
    }

    fallback() external payable {
        assembly {
            let _target := sload(0)
            calldatacopy(0x0, 0x0, calldatasize())
            let result := delegatecall(gas(), _target, 0x0, calldatasize(), 0x0, 0)
            returndatacopy(0x0, 0x0, returndatasize())
            switch result case 0 {revert(0, 0)} default {return (0, returndatasize())}
        }
    } 
}

// To deal with 24576 bytes limit

contract ProxyForAccountCreation is SignDocuBussiness {
    function createAccountMock(address _sender, string memory _accountPubKey) public {
        createAccount(_sender, _accountPubKey);
    }
}

contract ProxyForApprovingAccountCreation is SignDocuBussiness {
    function createAccountMock(address _sender, string memory _accountPubKey) public {
        createAccount(_sender, _accountPubKey);
    }

    function resetAccountMock(address _sender, string memory _accountPubKey) public {
        accounts[_sender] = _accountPubKey;
    }

    function allowAccountCreationMock(address _sender, address _allowed) public {
        allowAccountCreation(_sender, _allowed);
    }
}

contract ProxyForDocumentCreation is SignDocuBussiness {
    function resetAccountMock(address _sender, string memory _accountPubKey) public {
        accounts[_sender] = _accountPubKey;
    }

    function createDocumentMock(string memory _cid, string memory _secret, address _sender) public {
        createDocument(_cid, _secret, _sender);
    }
}

contract ProxyForDocumentSignatureApproval is SignDocuBussiness {

}

contract ProxyForDocumentSigning is SignDocuBussiness {
    function setDocumentState(string memory _cid, uint256 _state) public {
        documents[_cid].state = getStateFromUint(_state);
    }

    function setSignee(string memory _cid, address _signee) public {
        documents[_cid].newSignee = _signee;
    }

    function signMock(string memory _cid, string memory _secret, address _sender) public {
        sign(_cid, _secret, _sender);
    }

    function getStateFromUint(uint256 _state) public pure returns(State) {
        if (_state == 1) {
            return State.Created;
        }
        if (_state == 2) {
            return State.SignPending;
        }
        if (_state == 3) {
            return State.Signed;
        }
    }

    function deleteDocument(string memory _cid, address _sender) public {
        delete documents[_cid];
        delete documentsExist[_cid];
        for(uint i=0; i<creators[_sender].length; i++) {
            if(keccak256(abi.encodePacked(creators[_sender][i])) == keccak256(abi.encodePacked(_cid))) {
                for (uint j = i; j<creators[_sender].length-1; j++){
                    creators[_sender][j] = creators[_sender][j+1];
                }
                delete creators[_sender][creators[_sender].length];
            }
        }
    }
}
